import React from 'react';
import Head from 'next/head';
import { useAmp } from 'next/amp';
import Layout from '@components/layout/Layout';
import { AmpProvider } from '@utils/AmpContext';
import { StyledHeader } from '@components/Header/Header.styles';

const Index = () => {
  const isAmp = useAmp();
  return (
    <AmpProvider isAmp={isAmp}>
      <Head>
        <title>Emanuel Menezes - Engenheiro Civil</title>
        <meta name="Description" content="Descrição da página Home" />
        <meta name="robots" content="index, follow" />
        <link rel="canonical" href="https://hardcore-shaw-514a54.netlify.app//" />
        <link rel="amphtml" href="https://amp.emanuelmenezes.com.br" />
      </Head>
      <Layout>

        <main>
          <StyledHeader />

          Home do boilerplate do NextJs
        </main>
      </Layout>
    </AmpProvider>
  );
};

export default Index;
